function minimumBribes(q = [], memo = {}, total = 0) {
  if (q.length === 0) {
    console.log(0);
    return;
  }
  let savedI = 0;
  for (let i = 0; i < q.length; i++) {
    const element = q[i];
    if (element - q[i + 1] > 0) {
      total++;
      if (element in memo) {
        memo[element] += 1;
        if (memo[element] >= 3) {
          console.log(`Too chaotic`);
          return;
        }
      } else {
        memo[element] = 1;
      }
      // console.log(q, element, memo[element]);
      q.splice(i, 2, ...[q[i + 1], element]);
      i = savedI;
    }
    if (i + 1 === q[i]) savedI = i;
  }
  for (let index = q.length; index > 0; index--) {
    if (index !== Number(q[index - 1])) {
      return minimumBribes(q, memo, total);
    }
  }
  // console.log(memo);
  // console.log(q === q.sort((a, b) => a - b));
  console.log(total);
}

